import React from 'react'

const Home = () => {
    return (
        <div style={{display:'flex', justifyContent:'center', alignItems:'center', height:'90vh'}}>
            <h1>This is home page</h1>
        </div>
    )
}


const Portfolio = () => {
    return (
        <div style={{display:'flex', justifyContent:'center', alignItems:'center', height:'90vh'}}>
            <h1>This is home page</h1>
        </div>
    )
}

export default Home
